def test_pcap_flow1():
    data = Flow(testfile)
    for k in data.ft.keys():
        assert (k[1], k[0], k[3], k[2]) not in data.ft
    assert len(data.ft) == 16654 or len(data.ft) == 255871

def test_pcap_flow2():
    data = Flow(testfile).ft
    data_sorted = sorted(data.items(),
            key=lambda item: item[1], reverse=True)
    testdata_sorted = sorted(testdata.items(),
            key=lambda item: item[1], reverse=True)
    c = 0
    while c < 5:
        k = testdata_sorted[c][0]
        rk = (k[1], k[0], k[3], k[2])
        assert data_sorted[c][0] == k or data_sorted[c][0] == rk
        c += 1

def test_pcap_flow3():
    data = Flow(testfile)
    for k, v in testdata.items():
        rk = (k[1], k[0], k[3], k[2])
        if k in data.ft:
            assert data.ft[k] == v
        elif rk in data.ft:
            assert data.ft[rk] == v
